import React, { useEffect, useState } from 'react'

export default function Home() {
  let [product,setProduct] = useState(null)
  useEffect(()=> {
    
      fetch("https://assessment.api.vweb.app/rides")
      .then((response) => response.json())
      .then((data)=> {
        setProduct(data);
      })
      
    
  },[])
  
  console.log(product);
  if(product) {
    return (
      <>
          {product.map((item) => {
            return (
              <>
              <h4> Ride id :
                {item.id}
              </h4>
              <h4>Origin Station : {item.origin_station_code} </h4>
              <h4>station_path : 
                {item.stat}
              </h4>
              </>
            )
          })
        } 
      </>
    )
    }
}
